  nursed in Christchurch, Sydney and London. She returned to New Zealand and did BA (Hons) in 1985
  and Dipl TESL in 1984 at Victoria University then did her PhD in Linguistics at MIT. She now
  teaches in Canterbury University Department of Linguistics, specialising in syntax and semantics.
  Her interests include reading, gardening and cinema.
